import React,{ Component } from "react";

class NurseEdit extends Component{
    constructor(props){
        super(props);

        this.state = {
            isLoaded    : false,
            nurse       : {},
            nid         : this.props.nid,
            fname       : '',
            lname       : '',
            email       : '',
            phone       : '',
            gender      : 'M',
            location    : ''

        }
    }
    render(){
        return(
            <div>
                {this.state.nid}
            </div>
        )
    }
}

export default NurseEdit;
